package com.acc.inheritance;

class Demo {
	
}


public class InstanceOperator {
	
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Demo d = new Demo();
		Demo d1 = null;
		System.out.println(d instanceof Demo);
		System.out.println(d1 instanceof Demo);
		
	}

}
